import React, { Component } from 'react';

export default class NavBar extends Component {
    render() {
        return (
            <div>
                <link type="text/css" rel="stylesheet" href="../css/labstyle.css" />


                <nav class="navbar navbar-expand-lg navbar-light fixed-top sticky-top">



  <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
    <span class="navbar-toggler-icon"></span>
  </button>
  <div class="collapse navbar-collapse" id="navbarResponsive">
    <ul class="navbar-nav">
      <li class="nav-item">
      <a className="puka" href="/"><span class="fa fa-flask" aria-hidden="false"> SAKURA Laboratory</span></a>

      </li>

    </ul>
  </div>
              <hr/>

</nav>
</div>




        );
    }
}
